import React, {Component} from 'react';
import Photo1 from './Photos/GoodFork1.jpeg'
import Photo2 from './Photos/GoodFork2.jpg'
import './Photo.css'

const photos = [{
    photo: {firstProjectPhoto},
    text:"first project"
},
{
    photo: {secondProjectPhoto},
    text:"second project"
},
{
    photo: {thirdProjectPhoto},
    text:"third project"
}
]

class Photo extends Component{

    render(){
        return(
            <div className="photo">
            <img src={Photo1} alt="photo1"/>
            <img src={Photo2}/>
            </div>
        );
    }
}

export default Photo
